import React, { useState, useEffect } from "react";
function App() {
  let [counter, setCount] = useState(0);
  useEffect(() => {
    document.write("hello " + counter);
  }, [counter]);
  return (
    <>
      <h1>Counter {counter}</h1>
      <button onClick={() => setCount(counter + 1)}>click</button>
    </>
  );
}
export default App;
